import React from "react";
import Navbar from "./Navbar";
import "./Projects.css";


import project1 from "./assets/project1.jpg";
//import project2 from "./assets/project2.jpg";
//import project3 from "./assets/project3.jpg";
//import project4 from "./assets/project4.jpg";
//import project5 from "./assets/project5.jpg";
//import project6 from "./assets/project6.jpg";
//import project7 from "./assets/project7.jpg";

const Projects = () => {
    const projectData = [
        { id: "01", title: "Hybrid:Mix", img: "deepa-portfolio/src/assets/10.png" },
        { id: "02", title: "Urban Campus Housing", img: "/assets/project2.jpg" },
        { id: "03", title: "Jinbocho Sliding Park", img: "/assets/project3.jpg" },
        { id: "04", title: "Fakescapes", img: "/assets/project4.jpg" },
        { id: "05", title: "The Component", img: "/assets/project5.jpg" },
        { id: "06", title: "Pixelate: Analog", img: "/assets/project6.jpg" },
        { id: "07", title: "Boom! On the Go", img: "/assets/project7.jpg" },
    ];

    return (
        <>
            <Navbar />
            <div className="project-hero">
                <div className="project-hero-content">
                    <div className="project-hero-year">
                        <p>2019</p>
                        <div className="line"></div>
                        <p>2024</p>
                    </div>
                    <div className="project-hero-title">
                        <h1>PROJECTS</h1>
                        <p>of Deepa Devangmath</p>
                    </div>
                </div>
            </div>

            {/* New Section */}
            <div className="table-of-contents-section">
                <h2>Table of Contents</h2>
                <div className="contents-list">
                    {projectData.map((project) => (
                        <div className="content-item" key={project.id}>
                            <div className="content-image">
                                <img src={project.img} alt={project.title} />
                            </div>
                            <div className="content-details">
                                <span>{project.id}</span>
                                <p>{project.title}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </>
    );
};

export default Projects;
